function App() {
  const expenses = [
    {
      title: "Prova spesa 1",
      amount: 123.53,
      date: new Date(2022, 3, 22),
    },
    {
      title: "Prova spesa 2",
      amount: 123.53,
      date: new Date(2022, 3, 22),
    },
    {
      title: "Prova spesa 3",
      amount: 123.53,
      date: new Date(2022, 3, 22),
    },
    {
      title: "Prova spesa 4",
      amount: 123.53,
      date: new Date(2022, 3, 22),
    },
    {
      title: "Prova spesa 5",
      amount: 123.53,
      date: new Date(2022, 3, 22),
    },
  ];

  return (
    <div>
      <ExpenseItem />
      <ExpenseItem />
    </div>
  );
}

export default App;
